TITLE:
  - A multiphase porous medium (2D) example including transport and
  - reactions with 1D-3D coupling. Testing blood vessel collapse and
  - additional deletion of free hanging elements
  - '- Two tumors are growing and starting to compress an embedded 1D blood'
  - vessel
  - '- Diameter of embedded blood vessel is governed by function 14'
  - '- this leads to slow blood vessel compression and eventually'
  - collapse inside the two tumors
  - '- a free-hanging 1D piece emerges which is not connected to the in- or'
  - outlets of the domain --> this piece is additionally deleted
PROBLEM SIZE:
  DIM: 2
PROBLEM TYPE:
  PROBLEMTYPE: "Multiphase_Poroelasticity_ScaTra"
POROMULTIPHASESCATRA DYNAMIC:
  RESTARTEVERY: 48
  NUMSTEP: 10
  MAXTIME: 90000
  TIMESTEP: 1800
  COUPALGO: "twoway_monolithic"
  ARTERY_COUPLING: true
POROMULTIPHASESCATRA DYNAMIC/MONOLITHIC:
  VECTORNORM_RESF: "Rms"
  TOLRES_GLOBAL: 1e-06
  TOLINC_GLOBAL: 1e-06
  LINEAR_SOLVER: 1
POROMULTIPHASE DYNAMIC:
  SOLVE_STRUCTURE: false
  COUPALGO: "twoway_monolithic"
STRUCTURAL DYNAMIC:
  INT_STRATEGY: "Standard"
  DYNAMICTYPE: "OneStepTheta"
  LINEAR_SOLVER: 1
STRUCTURAL DYNAMIC/ONESTEPTHETA:
  THETA: 1
POROFLUIDMULTIPHASE DYNAMIC:
  THETA: 1
  LINEAR_SOLVER: 1
  INITIALFIELD: "field_by_condition"
  INITFUNCNO: 1
  FLUX_PROJ_SOLVER: 2
POROFLUIDMULTIPHASE DYNAMIC/ARTERY COUPLING:
  ARTERY_COUPLING_METHOD: "MP"
  REACFUNCT_ART: "11"
  SCALEREAC_ART: "-1"
  REACFUNCT_CONT: "0 0 11"
  SCALEREAC_CONT: "0 0 1"
  DELETE_FREE_HANGING_ELES: true
SCALAR TRANSPORT DYNAMIC:
  SOLVERTYPE: "nonlinear"
  MAXTIME: 1
  NUMSTEP: 10
  THETA: 1
  INITIALFIELD: "field_by_condition"
  SKIPINITDER: true
  LINEAR_SOLVER: 1
SCALAR TRANSPORT DYNAMIC/STABILIZATION:
  STABTYPE: "no_stabilization"
  DEFINITION_TAU: "Zero"
  EVALUATION_TAU: "integration_point"
  EVALUATION_MAT: "integration_point"
SCALAR TRANSPORT DYNAMIC/NONLINEAR:
  ITEMAX: 50
  CONVTOL: 1e-08
  ABSTOLRES: -1
SCALAR TRANSPORT DYNAMIC/ARTERY COUPLING:
  ARTERY_COUPLING_METHOD: "MP"
  REACFUNCT_ART: "12"
  SCALEREAC_ART: "-1"
  REACFUNCT_CONT: "12 0"
  SCALEREAC_CONT: "1 0"
ARTERIAL DYNAMIC:
  DYNAMICTYPE: "Stationary"
  SOLVESCATRA: true
  LINEAR_SOLVER: 1
  INITFUNCNO: 2
  INITIALFIELD: "field_by_condition"
SOLVER 1:
